import React, { useState, useEffect } from 'react';

const GetApi = () => {

    const [products, setProducts] = useState([])

    const fetchData = () => {
      fetch("https://fakestoreapi.com/products")
        .then(response => {
          return response.json()
        })
        .then(data => {
            setProducts(data)
        })
    }
  
    useEffect(() => {
      fetchData()
    }, [])
  
    return (
      <div>
        {products.length > 0 && (
          <table>
            <tr>
                <th>Title</th>
                <th>Price</th>
                <th>Country</th>
            </tr>
            {products.map(product => (
              <tr key={product.id}>{product.title}{product.price}</tr>
            ))}
          </table>
        )}
      </div>
    )
  }

export default GetApi;
